import React from 'react';
import headerStyleSheet from './Header.module.css';

const Header=() =>{

    return (
        <div className= 'Header'>
           <ul>
               <li>
               Portefeuille
               </li>
               <li>
               Composition  
               </li>
               <li>
               SCR  
               </li>
               <li>
               ESG 
               </li>
               <li>
               Climat
               </li>
           </ul>
        </div>

    );
}

export default Header;
